import React from "react";
import Card from "../../components/Card/Card";
import { useNavigate } from "react-router-dom";


export default function DashboardFamiliar() {
    const nav = useNavigate();
    return (
        <div style={{ padding: 24 }}>
            <h2>Dashboard do Familiar</h2>
            <div style={{ display: "flex", gap: 16, marginTop: 16, flexWrap: "wrap" }}>
                <Card title="Idosos Acompanhados" description="Ver perfis dos idosos que vocÃª acompanha" onClick={() => nav('/familiar/idosos') }>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/familiar/idosos')}>Abrir</button></div>
                </Card>


                <Card title="Lista de Desejos" description="Gerenciar desejos do idoso" onClick={() => nav('/familiar/lista-desejos') }>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/familiar/lista-desejos')}>Abrir</button></div>
                </Card>


                <Card title="Enviar Mensagem" description="Enviar alerta ou recado para o idoso" onClick={() => nav('/familiar/mensagens') }>
                    <div style={{ marginTop: 12 }}><button onClick={() => nav('/familiar/mensagens')}>Abrir</button></div>
                </Card>
            </div>
        </div>
    );
}
